import logo from './logo.svg';
import './App.css';
import './HomePage.js';
import './AboutUs';
import HomePage from './HomePage.js';
import AboutUs from './AboutUs.js';
import { BrowserRouter,Route } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
        <Route exact path='/' component={HomePage}/>
        <Route path='/' component={AboutUs}/>
        </Routes>
      </BrowserRouter>
      <HomePage/>
    </div>
  );
}

export default App;
